ghfood #foodporn #foodphotography #foodstagram #foodie #foodblogger #foodblogeats #foodlover #igfood #instagood #instafood #forkyeah #eeeats #foodgram #feedfeed #foodgawker #foodgasm #foodfeed #food #foodpassion #eatwell  #getinmybelly #devourpower";}i:173;a:1:{s:14:"comments_count";i:2;}i:174;a:1:{s:11:"likes_count";i:13;}i:175;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuh4DGFjst";}i:176;a:1:{s:5:"image";s:260:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118811435_2797529370483747_4825230561366747046_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=103&_nc_ohc=9NRt9I6Isv0AX-Pr8GY&_nc_tp=15&oh=6983b55c086667642d7f4c8f0bfd8e84&oe=5F7C8FB4";}i:177;a:1:{s:4:"type";s:7:"sidecar";}i:178;a:1:{s:8:"owner_id";i:192343281;}i:179;a:1:{s:14:"owner_username";s:0:"";}i:180;a:1:{s:14:"owner_fullname";s:0:"";}i:181;a:1:{s:9:"owner_pic";s:0:"";}i:182;a:1:{s:2:"id";s:19:"2390997238028878492";}i:183;a:1:{s:10:"short_code";s:11:"CEuh1HnpsKc";}i:184;a:1:{s:12:"created_time";i:1599249103;}i:185;a:1:{s:7:"caption";s:2088:"Tonight we are trying some Vegan Soft Pretzels by Zuliya Khawaja ü•®
Ingredients
1/4 ounce active dry yeast (1 package)
1 cup warm water
1/4 cup maple syrup
1 1/2 teaspoon salt
2 tbsp of melted vegan butter
2 1/2 cups all-purpose flour, plus more Oil for greasing
7 cups water
1/2 cup baking soda
1 tablespoon coarse salt for sprinkling
Method:
1. In a large bowl, combine yeast, 1 cup warm water, maple syrup, and salt stirring until the yeast is dissolved. Let stand for 10 minutes, or until it is bubbly.
2. Add the melted butter to the yeast mixture then gradually add the flour until a soft dough forms. Add extra flour if necessary. Dough shouldn't be sticky or too firm.
3. Turn the dough out onto a clean work surface and knead until elastic and smooth, about 5-10 minutes.
4. Place dough in a lightly oiled bowl, cover, & let rise in a warm place for about 1 hour. Dough must double in size.
5. Preheat the oven to 410 F. 
6. Lightly oil a large baking sheet and set aside. Bring the 7 cups of water and baking soda to boil in a medium-large saucepan over medium-high heat.
8. Press down the dough and turn out onto a clean work surface. Separate the dough into 8 pieces and roll each into a rope about 1/2-inch thick.
9. Twist the ropes into pretzel shapes, securing both of the ends on the base of the pretzel.
10. Drop 1 pretzel at a time into the boiling water. Boil for about 30 seconds, carefully 
remove using a slotted spoon, and transfer to the prepared baking sheet.Repeat this until all of your pretzels have been boiled.
11. Sprinkle with coarse salt and bake until golden brown, about 15 minutes. Allow pretzels to cool slightly before serving. Serve warm with dips. Enjoy!
